/*Table structure for table `shared_files` */

DROP TABLE IF EXISTS `shared_files`;

CREATE TABLE `shared_files` (
  `file_id` int(11) NOT NULL,
  `shared_with` varchar(22) NOT NULL,
  `owner_id` varchar(22) NOT NULL,
  PRIMARY KEY (`file_id`,`owner_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `shared_files` */

insert  into `shared_files`(`file_id`,`shared_with`,`owner_id`) values (1,'user01','utkarsh');

/*Table structure for table `shared_nodes` */

DROP TABLE IF EXISTS `shared_nodes`;

CREATE TABLE `shared_nodes` (
  `node_id` int(11) DEFAULT NULL,
  `user_name` varchar(20) DEFAULT NULL,
  `owner_name` varbinary(20) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `shared_nodes` */

insert  into `shared_nodes`(`node_id`,`user_name`,`owner_name`) values (19,'user01','utkarsh'),(6,'utkarsh','user01'),(15,'user01','utkarsh');

/*Table structure for table `user_roles` */

DROP TABLE IF EXISTS `user_roles`;

CREATE TABLE `user_roles` (
  `USER_ROLE_ID` int(10) unsigned NOT NULL,
  `USER_ID` int(10) unsigned NOT NULL,
  `AUTHORITY` varchar(45) NOT NULL,
  PRIMARY KEY (`USER_ROLE_ID`),
  KEY `FK_user_roles` (`USER_ID`),
  CONSTRAINT `FK_user_roles` FOREIGN KEY (`USER_ID`) REFERENCES `users` (`USER_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `user_roles` */

insert  into `user_roles`(`USER_ROLE_ID`,`USER_ID`,`AUTHORITY`) values (1,1,'ROLE_USER'),(2,2,'ROLE_USER');

/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `USER_ID` int(10) unsigned NOT NULL,
  `USERNAME` varchar(45) NOT NULL,
  `PASSWORD` varchar(45) NOT NULL,
  `ENABLED` tinyint(1) NOT NULL,
  PRIMARY KEY (`USER_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `users` */

insert  into `users`(`USER_ID`,`USERNAME`,`PASSWORD`,`ENABLED`) values (1,'utkarsh','utkarsh',1),(2,'user01','user01',1);

